// Dokumenty.js
import React from "react";
import Sidebar from "./Sidebar"; // Import Sidebar component
import Header from "./Header";  // Import Header component
import "./Dokumenty.css"; // Optional: Separate styles for the Dokumenty page

const Dokumenty = () => {
  const user = JSON.parse(localStorage.getItem("user")) || {}; // Load user data
  const handleLogout = () => {
    localStorage.removeItem("isAuthenticated");
    window.location.href = "/"; // Redirect to login on logout
  };

  return (
    <div className="dashboard-container">
      {/* Sidebar */}
      <Sidebar />

      {/* Main  */}
      <div className="main-content">
        {/* Header */}
        <Header user={user} onLogout={handleLogout} />

        <div className="dokumenty-content">
          <h1>Dokumenty</h1>
          <p>This is the Dokumenty page content.</p>
        </div>
      </div>
    </div>
  );
};

export default Dokumenty;
